import styled from "styled-components"

export const Container = styled.div`
    position: absolute;
    width: 375px;
    height: 677px;
    left: 0px;
    top: 0px;   
    background: linear-gradient(274.42deg, #92A3FD 0%, #9DCEFF 124.45%);
    border-radius: 40px 40px 0px 0px;
`;
